import React, {Component} from 'react';
import { BrowserRouter, Route, Switch } from "react-router-dom";
import FetchQuiz from './components/fetchQuiz'

class App extends Component {
    constructor(props) {
        super(props);
        this.state = { };
    };

    componentDidMount() {
    }

    componentDidUpdate(prop) {}

    render() {

        return(
            <BrowserRouter>
                <Switch>
                    <Route exact path="/quiz/:id" component={() => <FetchQuiz quizId={6876876} />} />
                </Switch>
            </BrowserRouter>
        )

    }
}

export default App;
